import React, { Component } from "react";

function printTable() {
  for (var i = 1; i <= 10; i++) {
    document.write("-");
    document.write("<br>");
    for (var j = 1; j <= 10; j++) {
      if ((j * i) % 2 == 1) document.write("(Odd)");
      else document.write("(Even)");
      document.write(i * j);
      document.write("&nbsp&nbsp&nbsp");
    }
  }
}
printTable();

class App extends Component {
  render() {
    return <div className="container">heloo</div>;
  }
}

export default App;
